import React, { useState } from 'react';
import { Sidenav, Toggle, Nav, Icon, Dropdown } from 'rsuite';
import { GrNotes } from 'react-icons/gr';

export default function Drawer() {
  const [expanded, setExpanded] = useState(true);
  const [activeKey, setActiveKey] = useState('1');
  const handleToggle = () => {
    setExpanded(!expanded);
  };
  const handleSelect = (eventKey: any) => {
    setActiveKey(eventKey);
  };

  return (
    <div style={{ width: 250 }}>
      <Sidenav
        expanded={expanded}
        defaultOpenKeys={['3', '4']}
        activeKey={activeKey}
        onSelect={handleSelect}
        style={{ height: '100vh' }}
      >
        <Sidenav.Body>
          <Nav>
            <Nav.Item eventKey="1" icon={<Icon icon="dashboard" />}>
              o-note
            </Nav.Item>
            <Nav.Item eventKey="2" icon={<Icon icon="table" />}>
              all notes
            </Nav.Item>
            <Dropdown
              placement="rightStart"
              eventKey="3"
              title="notebooks"
              icon={<Icon icon="notebook" />}
            >
              <Dropdown.Item eventKey="3-1">1</Dropdown.Item>
              <Dropdown.Item eventKey="3-2">2</Dropdown.Item>
              <Dropdown.Item eventKey="3-3">3</Dropdown.Item>
              <Dropdown.Item eventKey="3-4">4</Dropdown.Item>
            </Dropdown>
            <Nav.Item eventKey="2" icon={<Icon icon="trash" />}>
              trash
            </Nav.Item>
            <Toggle
              onChange={handleToggle}
              checked={expanded}
              style={{ float: 'right' }}
            />
          </Nav>
        </Sidenav.Body>
      </Sidenav>
    </div>
  );
}
